import React from 'react';

function AdminProfile() {
  return (
    <div>
      <h2>معلومات الأدمن الشخصية</h2>
      <p>هنا يمكنك عرض وتعديل معلومات الأدمن.</p>
    </div>
  );
}

export default AdminProfile;
